INSERT INTO `nao_conformidade` VALUES (1,'SEM  ORDEM DE SERVIÇO','S','Não recebemos a Ordem de serviço gerada pelo sistema que acompanha os medicamentos. Solicitamos gentileza fazer a abertura, se não houver o envio o(s) medicamento(s) serão devolvidos sem a prestação do serviço. Quaisquer dúvidas, entre em contato no telefone: 31 988740075'),(3,'QUANTIDADE MEDICAMENTOS','N','Medicamento recebido em quantidade diferente da informada na Ordem de serviço, isso não impede o processo, mas caso não devamos realizar o serviço, entre em contato no telefone: 31 988740075'),(4,'INTEGRIDADE VISUAL DAS EMBALAGENS SECUNDÁRIAS','N','Medicamento com embalagem secundária ou hospitalar com danos que podem interferir no controle do processo: (umidade, alta temperatura, etc.). Solicitamos acompanhamento desta NC. Quaisquer dúvidas, entre em contato no telefone: 31 3465.9415'),(5,'DIVERG.NOME, DCB, LOTE, VAL, RASTREIO, ETC.','S','O medicamento foi recebido com informações de nome, val, lote, cód. rastreio distintas das informadas na Ordem de Serviço. Solicitamos acessar o submenu Desbloqueio  do sistema e corrigir  as informações, enquanto isso medicamento ficará em quarentena. Quaisquer dúvidas, entre em contato no telefone: 31 988740075'),(6,'DANO INTEGRIDADE DO MEDICAMENTO','S',' Medicamento com dano de integridade ( blister rompido, odor, esfarelamento, cor, etc.) que impede a  unitarização/etiquetamento. Isso foi percebido em alguma etapa do processo, assim ficará  em quarentena e devolvido  juntamente com  os outros medicamentos. Solicitamos acompanhamento desta NC. Quaisquer dúvidas, entre em contato no telefone: 31 988740075'),(7,'MEDICAMENTO NÃO RECEBIDO','N','Não recebemos o medicamento que foi digitado na Ordem de Serviço gerada pelo sistema. Solicitamos gentileza fazer o acompanhamento. Quaisquer dúvidas, entre em contato pelo whatsApp 31988740075.\n'),(8,'NÃO PROCESSADO','N','Medicamento não foi  ou foi parcialmente envelopado devido a quebra/perda que estava sendo além do estimado, provavelmente  por fragilidade da ampola ou tamanho dos comprimidos/cápsulas. Assim poderão ser etiquetados, caso autorize ou devolvidos sem a prestação do serviço. Solicitamos acompanhamento desta NC. Quaisquer dúvidas , entre em contato no telefone: 31988740075');
/*!40000 ALTER TABLE `nao_conformidade` ENABLE KEYS */;
UNLOCK TABLES;

